import './App.css';
import React, { Component } from "react";
import { connect, sendMsg } from "./api";
import Header from "./components/Header/Header";

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            chatHistory: []
        }
    }

    send() {
        console.log("Sending msg");
        sendMsg("Hello");
    }
    render() {
        return (
            <div className="App">
                <Header />
                <button onClick={this.send}>Hit</button>
            </div>
        );
    }

}

export default App;
